import React, { useState, useEffect } from "react";

function MaaS360Data() {
  const [devices, setDevices] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/maas360")
      .then((response) => response.json())
      .then((data) => {
        setDevices(data);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>Device Data</h1>
      <p>{devices.length > 0 ? devices[0].name : 'No devices found'}</p>
    </div>
  );
}

export default MaaS360Data;



